      SUBROUTINE JACS1(N,T,Y,ML,MU,DYDN,NROW)
 
      IMPLICIT NONE
 
      INTEGER I,J,ML,MU
      INTEGER G,H
      PARAMETER (G=1000)
      PARAMETER (H=10000)
 
      INTEGER N,NROW
 
      DOUBLE PRECISION T,K(H)
      DOUBLE PRECISION X(1),TOTAL(1)
      DOUBLE PRECISION Y(N),DYDN(N,N)
      DOUBLE PRECISION GTOT,LAYERS,COV,DENSITES
      DOUBLE PRECISION HLOSS
 
      COMMON/BLK1/ K,X,TOTAL,HLOSS,DENSITES
 
 
C Total grain mantle abundance
 
      GTOT=0.0
     *                                                                  
 
      LAYERS = GTOT/(2.0*DENSITES)
 
      IF (LAYERS.LT.1.0) COV = LAYERS/GTOT
      IF (LAYERS.GE.1.0) COV = 1.0/GTOT 
 
      IF (GTOT.EQ.0.0) COV = 0.0
 
C CF+       CF+       
      DYDN(1,1)=0.0
     * -(+K(906)*X(1)+K(6316))                                          
 
C CF+       HF        
      DYDN(1,125)=0.0
     * +K(1386)*Y(456)                                                  
 
C CF+       C+        
      DYDN(1,456)=0.0
     * +K(1386)*Y(125)                                                  
 
C ClO+      ClO+      
      DYDN(2,2)=0.0
     * -(+K(987)*X(1)+K(6525))                                          
 
C ClO+      ClO       
      DYDN(2,26)=0.0
     * +K(173)*Y(456)                                                   
 
      RETURN
      END
 
